def upload_image(img_base64):
    print("uplade image")
    headers = {
        'content-type': 'multipart/form-data; boundary=----WebKitFormBoundaryz4sSP4xCSI9Zmr2p',
        'Cookie': f'csrftoken={csrftoken}',
    }

    img_base64 = re.sub('^data:image/.+;base64,', '', img_base64)
    img = base64.b64decode(img_base64)

    multipart_form_data = {
        'demo_type': (None, 'demoImageType'),
        'type': (None, 'vqa'),
        'csrfmiddlewaretoken': (None, csrfmiddlewaretoken),
        'file': ('1 (17).jpg', img, 'image/jpeg')
    }

    mp_encoder = MultipartEncoder(
        fields=multipart_form_data, boundary='----WebKitFormBoundaryz4sSP4xCSI9Zmr2p')

    response = requests.post(f'{host_http}/upload/',
                             headers=headers, data=mp_encoder.to_string())

    print("uplade image result: ")
    print(response.status_code)

    result = json.loads(response._content)
    file_path = result['file_path']

    return file_path


def vqa(file_path, question, socketid):

    headers = {
        'content-type': 'application/x-www-form-urlencoded; charset=UTF-8;  boundary=----WebKitFormBoundaryz4sSP4xCSI9Zmr2p',
        "x-requested-with": "XMLHttpRequest",
        'Cookie': f'csrftoken={csrftoken}',
    }

    body = {
        'img_path': (None, file_path),
        'question': question,
        'type': (None, 'vqa'),
        'csrfmiddlewaretoken': (None, csrfmiddlewaretoken),
        'vqa_model': (None, 'pythia'),
        'socketid': (None, socketid)
    }

    response = requests.post(f'{host_http}/', headers=headers, data=body)

    print(response.status_code)
    # print(response._content)


async def get_answers(socketid):
    async with websockets.connect('ws://vqa.cloudcv.org/chat') as websocket:
        response = ''
        await websocket.send(socketid)
        trycounter = 0
        while trycounter < 10 and response.find('top5_list') == -1:
            # trycounter+=1
            # await websocket.send(socketid)
            response = await websocket.recv()
            print(response)

        if response.find('terminal') != -1:
            response = json.loads(response)['terminal']
        elif response.find('result') != -1:
            response = json.loads(response)['result']
        else:
            assert False

        global answers
        answers = json.loads(response)['top5_list']
        print('\n\n\n')


async def predictWithPythia(question, img_base64):
    file_path = upload_image(img_base64)
    print(file_path)
    socketid = str(uuid.uuid4())
    vqa(file_path, question, socketid)
    # asyncio.get_event_loop().run_until_complete(get_answers(socketid))
    await get_answers(socketid)
    for dic in answers:
        print('\t', dic['answer'], '\t\t', dic['confidence'])
    return answers[0]['answer']


